import tff from "../Resimler/tff.png";
import ziraat from "../Resimler/ziraat.png";
import kupa from   "../Resimler/kupa.png";




const Home = () => {



    return (
        <div>
            <Navbar />
            <hr/>
            <h3 style={{textAlign:"center",fontSize:18}}>Canlı Puan Durumu</h3>
            <Canlı/>
            <h3 style={{textAlign:"center",fontSize:18}}><img src={kupa} width="50" />Süperlig Şampiyonları<img src={kupa} width="50" /></h3><br/>
            <Slayt/><br/>
            <div style={{ textAlign: "center" }} className="">
                <img src={icon} width="200" />
                <img src={tff} width="200" />
                <img src={ziraat} width="200" />
            </div>
        </div>
    )
}

export default Home;
